import React from "react";
import Card from "./Cards";
import Sdata from "./Sdata";

const App = () => {
  <>
    <h1 className="heading_style"> List of Marvel Movies</h1>
    {Sdata.map((val, index) => {
      return (
        <Card
          key={val.id}
          imgsrc={val.imgsrc}
          title={val.title}
          mname={val.mname}
          link={val.link}
        />
      );
    })}
    ;
  </>;
};
export default App;
